import axios from 'axios';
import { useState } from 'react';

function EmployeeRegistration() {


    const [id, setId] = useState('');
    const [name, setName] = useState('');
    const [address, setAddress] = useState('');
    const [mobile, setMobile] = useState('');

    async function save(event) {
        event.preventDefault();
        try {
            await axios.post("http://localhost:8085/api/v1/emp",
                {
                    id: id,
                    employeeName: name,
                    employeeAddress: address,
                    mobile: mobile
                });
            alert("Employee Registration Successfull");
            setId("");
            setName("");
            setAddress("");
            setMobile("");
        }
        catch (err) {
            alert("Employee Registration Failed");
        }
    }

    return (
        <div className="container mt-4">
            <form>
                <div class="form-group">
                    <label> Name </label>
                    <input type="text" class="form-control" placeholder="Enter Name"
                        value={name}
                        onChange={(event) => {
                            setName(event.target.value);
                        }}
                    />
                </div>

                <div class="form-group">
                    <label> Address </label>
                    <input type="email" class="form-control" placeholder="Enter Address"
                        value={address}
                        onChange={(event) => {
                            setAddress(event.target.value);
                        }}
                    />
                </div>

                <div class="form-group">
                    <label> Mobile </label>
                    <input type="text" class="form-control" placeholder="Enter Mobile"
                        value={mobile}
                        onChange={(event) => {
                            setMobile(event.target.value);
                        }}
                    />
                </div>

                <button className="btn btn-primay mt-4" onClick={save}> Register </button>
            </form>

        </div>
    );
}

export default EmployeeRegistration;
